import React from "react";
import { NavLink } from "react-router-dom";

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';



const linkStyles = {
  display: "inline-block",
  width: "50px",
  padding: "12px",
  margin: "0 6px 6px",
  background: "blue",
  textDecoration: "none",
  color: "white",
};



function Navbar() {

  return (
    <div>
      <NavLink 
        to="/"
        exact
        activeStyle={{
          background: "darkblue",
        }}
      >
        Home
      </NavLink>

      <NavLink 
        to="/doctors"
        exact
        activeStyle={{
          background: "darkblue",
        }}
      >
        Doctors
      </NavLink>

      <NavLink 
        to="/patients"
        exact
        activeStyle={{
          background: "darkblue",
        }}
      >
        Patients
      </NavLink>

    </div>
  )

}

export default Navbar
